CREATE TABLE tbl_peternakan(
   id                INTEGER  NOT NULL PRIMARY KEY 
  ,id_provinsi       INTEGER  NOT NULL
  ,alamat_peternakan VARCHAR(63) NOT NULL
  ,nama_peternakan   VARCHAR(38) NOT NULL
  ,no_telp           VARCHAR(13)
  ,created_at        VARCHAR(4)
  ,updated_at        VARCHAR(4)
  ,FIELD8            VARCHAR(30)
  ,FIELD9            VARCHAR(30)
  ,FIELD10           VARCHAR(30)
);
